RAW_CERTS_ARR=('' 
'')


DEFAULT_BACKUP_FILE_SUFFIX='backed-up-by-'$(basename $0)'-script'
DEFAULT_ADDED_CONTENT_BY_SCRIPT_LINE='# added-content-by-'$(basename $0)'-script'
DEFAULT_CREATED_CONTENT_BY_SCRIPT_LINE='# created-content-by-'$(basename $0)'-script'

##################################################################
# FUNCTIONS
##################################################################

backupFile()
{
	# function params:
    	# $1 = file to backup
	# $2 = backup file name suffix
	
	if ! [ -z "$1" ]; then
		local -n fileToBackup=$1
	fi
	
	if ! [ -z "$2" ]; then
		local -n backupFileSuffix=$2
	fi
	
	if ! [ -z "$fileToBackup" ]; then
		if [ -z "$backupFileSuffix" ]; then
			backupFileSuffix=$DEFAULT_BACKUP_FILE_SUFFIX
		fi
		
		cp -v $fileToBackup $fileToBackup.$DEFAULT_BACKUP_FILE_SUFFIX
	fi
}

addPrefixAndSuffixForCerts()
{
	# function params:
    	# $1 = array of certs to work on
	
	CERT_PREFIX='\n-----BEGIN CERTIFICATE-----\n'
	CERT_SUFFIX='\n-----END CERTIFICATE-----\n'
	
	local -n rawCertsArr=$1
	
	# backup IFS value
	CURRENT_IFS=$IFS

	# reset IFS value
	IFS=""
	
	for i in "${rawCertsArr[@]}"
	do
		ready_certs+=($CERT_PREFIX$i$CERT_SUFFIX)
	done
	
	# rollback IFS value
	IFS=${CURRENT_IFS}
}

addCerts()
{
	# function params:
    	# $1 = array of certs to add
	# $2 = array of list of bundles to work on
	# $3 = array of list of certs folders to work on
	
	local -n certsArr=$1
	local -n bundlesArr=$2
	local -n foldersArr=$3
	
  CERTS_NAME_PREFIX='added-by-'$(basename $0)'-script'
	CERT_SERIAL_NUMBER=1
	
  # backup IFS value
	CURRENT_IFS=$IFS

	# reset IFS value to add support for array items with space IN THEM
	IFS=""  
  
	for i in "${bundlesArr[@]}"
	do
		if [ -s "$i" ]; then
			backupFile i
			
			for j in "${certsArr[@]}"
			do
				echo -e $j >> $i
			done
		fi
	done
	
	if [ "${#foldersArr[@]}" -gt 0 ]; then
		for i in "${foldersArr[@]}"
		do
			if [ -d "$i" ]; then
				cd $i
				
				for j in "${certsArr[@]}"
				do
					echo -e $j > ${CERTS_NAME_PREFIX}_${CERT_SERIAL_NUMBER}.crt
					let "CERT_SERIAL_NUMBER=$CERT_SERIAL_NUMBER+1"
				done
				
				let "CERT_SERIAL_NUMBER=0"
			fi
		done
		
		if [ -s "/usr/sbin/update-ca-certificates" ]; then
			/usr/sbin/update-ca-certificates --fresh
		fi
	fi

  # rollback IFS value
	IFS=${CURRENT_IFS}
	
	#echo ${certsArr[@]}
	#echo ${bundlesArr[@]}
	#echo ${foldersArr[@]}
}

addDataToFiles()
{
	# function params:
    	# $1 = array of files to append
	# $2 = array of files to create
	
	local -n appendArr=$1
	local -n createArr=$2
	
	for i in "${appendArr[@]}"
	do
		FILE=${!i}
		
		if ! [ -s "$FILE.$DEFAULT_BACKUP_FILE_SUFFIX" ]; then
			if [ -s "$FILE" ]; then
				backupFile FILE
			fi
			
      FILE_CONTENT=${i}_CONTENT
			FILE_CONTENT=${!FILE_CONTENT}
				
			if ! [ -z "$FILE_CONTENT" ]; then
        # if a file is inside a non-existant dir - create it while ignoring errors such as 'already exists'
        mkdir $(dirname $FILE) &>/dev/null
        # verify that the script didn't append data already in a case where the file didn't exist at all
        grep $DEFAULT_ADDED_CONTENT_BY_SCRIPT_LINE $FILE &>/dev/null
        
        if [ "$?" -ne 0 ]; then	
          echo -e $DEFAULT_ADDED_CONTENT_BY_SCRIPT_LINE >> $FILE
          echo -e $FILE_CONTENT >> $FILE
        fi
			fi
		fi
	done

	for i in "${createArr[@]}"
	do
		FILE=${!i}
		
		if ! [ -s "$FILE.$DEFAULT_BACKUP_FILE_SUFFIX" ]; then
			if [ -s "$FILE" ]; then
				backupFile FILE
			fi
			
			FILE_CONTENT=${i}_CONTENT
			FILE_CONTENT=${!FILE_CONTENT}
				
			if ! [ -z "$FILE_CONTENT" ]; then
        # if a file is inside a non-existant dir - create it while ignoring errors such as 'already exists'
        mkdir $(dirname $FILE) &>/dev/null
      
        echo -e $DEFAULT_CREATED_CONTENT_BY_SCRIPT_LINE > $FILE
				echo -e $FILE_CONTENT >> $FILE
			fi
		fi
	done
}

makeFilesExecutable()
{
  local -n executablesArr=$1

	for i in "${executablesArr[@]}"
	do
    FILE=${!i}
    
    chmod a+x $FILE
  done

}

showAllSettings()
{
	# function params:
  # $1 = array of files to append
	# $2 = array of files to create
	# $3 = array of list of bundles to work on
	# $4 = backup file name suffix
	
	local -n appendArr=$1
	local -n createArr=$2
	local -n bundlesArr=$3
	
	if [ -z "$4" ]; then
		backupFileSuffix=$DEFAULT_BACKUP_FILE_SUFFIX
	else
		backupFileSuffix=$4
	fi	
	
	echo "========================================================"
	echo "Proxy via Env (greping 'proxy'):"
	echo "========================================================"
	echo ""
	echo ""
	
	env | grep -i proxy
	
	echo "========================================================"
	echo "git via Env (greping 'git'):"
	echo "========================================================"
	echo ""
	echo ""
	
	env | grep -i git
  
	echo "========================================================"
	echo "Other files:"
	echo "========================================================"
	echo ""
	echo ""
		
	for i in "${appendArr[@]}"
	do
		FILE=${!i}
		
		if [ -s "$FILE" ]; then	
			echo "========================================================"
			echo "$FILE:"
			echo "========================================================"
			cat $FILE
			echo ""
			echo ""
		fi
	done

	for i in "${createArr[@]}"
	do
		FILE=${!i}
		
		if [ -s "$FILE" ]; then
			echo "========================================================"
			echo "$FILE:"
			echo "========================================================"
			cat $FILE
			echo ""
			echo ""			
		fi
	done
	
	for i in "${bundlesArr[@]}"
	do
		if [ -s "$i" ]; then
			if [ -s "$i.$backupFileSuffix" ]; then
				echo "========================================================"
				echo "$i:"
				echo "========================================================"
				ls -l $i
				ls -l $i.$backupFileSuffix
				echo ""
				echo ""				
			fi
		fi
	done
}

